jQuery(document).ready(function($){

  // Comments Carousel
  $('.carouselcommentsgrid').owlCarousel({
    stagePadding: 20,
    loop:true,
    autoplay:true,
    margin:0,
    responsiveClass:true,
    responsive:{
        0:{
            items:1,
            nav:true,
            dots:false
        },
        480:{
            items:2,
            nav:true
        },
        768:{
            items:3,
            nav:true
        },
        1000:{
            items:4,
            nav:true
        },
        1200:{
            items:5,
            nav:true
        }
    }
  });

  // Press Carousel
  $('.carouselpressgrid').owlCarousel({
    stagePadding: 20,
    loop:true,
    // autoplay:true,
    margin:0,
    dots:false,
    responsiveClass:true,
    responsive:{
        0:{
            items:1,
            nav:true
        },
        600:{
            items:2,
            nav:true
        },
        768:{
            items:3,
            nav:true
        },
        1000:{
            items:4,
            nav:true
        },
        1200:{
            items:5,
            nav:true
        }
    }
  });
  
  // Features Carousel
  $('.carouselfeaturesgrid').owlCarousel({
    stagePadding: 20,
    loop:true,
    // autoplay:true,
    margin:0,
    dots:false,
    responsiveClass:true,
    responsive:{
        0:{
            items:1,
            nav:true
        },
        600:{
            items:2,
            nav:true
        },
        768:{
            items:3,
            nav:true
        },
        1000:{
            items:4,
            nav:true
        },
        1200:{
            items:4,
            nav:true
        }
    }
  });
  
  // Reviews Carousel
  $('.carouselreviews').owlCarousel({
    stagePadding: 0,
    loop:true,
    autoplay:true,
    autoplayTimeout:7000,
    margin:0,
    dots:true,
    nav:false,
    responsiveClass:true,
    responsive:{
        0:{
            items:1,
        },
        600:{
            items:2,
        },
        920:{
            items:3,
        }
    }
  });

});


