/*--- FAQs Toggle ---*/
jQuery(document).ready(function($) {

$(".toggle").each( function () {
  if($(this).attr('data-id') == 'closed') {
    $(this).accordion({ header: 'h4.toggle-title', collapsible: true, active: false  });
  } else {
	$(this).accordion({ header: 'h4.toggle-title', collapsible: true});
  }
});

});

