/*------------------------------------------------------------------*/


/*--- Footer Navs ---*/
jQuery(document).ready(function($) {
  
$(function() {
	var footernav	 = $('.togglefooternav');
		thenav 		   = $('.footernav');
		thenavHeight = thenav.height();

	$(footernav).on('click', function(e) {
		e.preventDefault();
		thenav.slideToggle(300);
	});

	$(window).resize(function(){
   		var w = $(window).width();
   		if(w > 320 && thenav.is(':hidden')) {
   			thenav.removeAttr('style');
   		}
	});
});

});


